import blogs from "../services/blogs";
import Togglable from "./Togglable";
const Blog = ({ blog }) => {
	const blogStyle = {
		paddingTop: 10,
		paddingLeft: 2,
		border: "solid",
		borderWidth: 1,
		marginBottom: 5,
	};

	return (
		<div style={blogStyle}>
			<p>title :{blog.title}
			<Togglable buttonLabel="show">
				<p>author :{blog.author}</p>
				<p>url :{blog.url}</p>
				<p>likes :{blog.likes}</p>
			</Togglable>
      </p>
		</div>
	);
};

export default Blog;
